class Solution {
    let order = [0, 2, 4, 6, 8, 5, 7, 3, 1, 9]
    
    func originalDigits(_ s: String) -> String {
        var s = s
        var r = [Int](repeatElement(0, count: 10))
        let functions: [((inout String) -> Int)] = [zero, one, two, three, four, five, six, seven, eight, nine]
        
        for o in order {
            r[o] += functions[o](&s)
        }
        
        var a = ""
        for (i, v) in r.enumerated() {
            for j in 0..<v {
                a.append("\(i)")
            }
        }
        
        return a
    }
    
    func zero(_ s: inout String) -> Int {
        let time = s.removeAll(c: "z")
        s.remove(c: "e", time: time)
        s.remove(c: "r", time: time)
        s.remove(c: "o", time: time)
        return time
    }
    
    func one(_ s: inout String) -> Int {
        let time = s.removeAll(c: "o")
        s.remove(c: "n", time: time)
        s.remove(c: "e", time: time)
        return time
    }
    
    func two(_ s: inout String) -> Int {
        let time = s.removeAll(c: "w")
        s.remove(c: "t", time: time)
        s.remove(c: "o", time: time)
        return time
    }
    
    func three(_ s: inout String) -> Int {
        let time = s.removeAll(c: "t")
        s.remove(c: "h", time: time)
        s.remove(c: "r", time: time)
        s.remove(c: "e", time: time * 2)
        return time
    }
    
    func four(_ s: inout String) -> Int {
        let time = s.removeAll(c: "u")
        s.remove(c: "f", time: time)
        s.remove(c: "o", time: time)
        s.remove(c: "r", time: time)
        return time
    }
    
    func five(_ s: inout String) -> Int {
        let time = s.removeAll(c: "f")
        s.remove(c: "i", time: time)
        s.remove(c: "v", time: time)
        s.remove(c: "e", time: time)
        return time
    }
    
    func six(_ s: inout String) -> Int {
        let time = s.removeAll(c: "x")
        s.remove(c: "s", time: time)
        s.remove(c: "i", time: time)
        return time
    }
    
    func seven(_ s: inout String) -> Int {
        let time = s.removeAll(c: "v")
        s.remove(c: "s", time: time)
        s.remove(c: "e", time: time * 2)
        s.remove(c: "n", time: time)
        return time
    }
    
    func eight(_ s: inout String) -> Int {
        let time = s.removeAll(c: "g")
        s.remove(c: "e", time: time)
        s.remove(c: "i", time: time)
        s.remove(c: "h", time: time)
        s.remove(c: "t", time: time)
        return time
    }
    
    func nine(_ s: inout String) -> Int {
        let time = s.removeAll(c: "i")
        s.remove(c: "n", time: time * 2)
        s.remove(c: "e", time: time)
        return time
    }
}

extension String {
    func index(of c: Character) -> Index? {
        return self.characters.index(of: c)
    }
    
    func index(of s: String) -> [Index]? {
        var v: [Index] = []
        for c in s.characters {
            guard let i = index(of: c) else {
                return nil
            }
            v.append(i)
        }
        return v
    }
    
    mutating func removeCharacters(in s: String) -> Bool {
        if let indexes = self.index(of: s) {
            let sortedIndexes = indexes.sorted { $0 > $1 }
            for i in sortedIndexes {
                self.remove(at: i)
            }
            return true
        }
        return false
    }
    
    subscript (i: Int) -> Character {
        return self[index(startIndex, offsetBy: i)]
    }
    
    mutating func remove(c: Character, time: Int) {
        if time == 0 { return }
        
        var time = time
        let range = (0..<self.characters.count).reversed()
        for i in range {
            if self[i] == c {
                self.remove(at: self.index(self.startIndex, offsetBy: i))
                time -= 1
                if time == 0 {
                    return
                }
            }
        }
    }
    
    mutating func removeAll(c: Character) -> Int {
        var time = 0
        let range = (0..<self.characters.count).reversed()
        for i in range {
            if self[i] == c {
                self.remove(at: self.index(self.startIndex, offsetBy: i))
                time += 1
            }
        }
        
        return time
    }
}

